window.bookSummaryJSON = "<p>Dr. Ralph Greenson, the star of Hollywood psychoanalysts, treated Marilyn Monroe for 15 months until her August 1962 suicide. He saw her seven days a week and brought her into his home. He never got over losing her. Written by a practicing psychoanalyst, <i>The Misfit</i> recounts this tragic alliance and Marilyn Monroe’s borderline personality.</p>"; 
